import './App.css';
import Books from "./Books";

function App() {
  const BooksList = Books.map((book) => {

    return (
      <div className="Book">
        <img className="book-image" alt={book.name} src={book.image} />
        <p className="text">{book.name}</p>
      </div>
    )
  });

  return (
    <div>
      <div>
        <h1 className="text">BookStore</h1>
        <h4 className="text">Where you can find Books</h4>
        <img
          alt="Books shop"
          src="https://i.pinimg.com/originals/e7/f5/52/e7f55226e1f9fa93978e677db0b85844.jpg"
          className="shop-image"
        />
      </div>
      <div className="list">
        {BooksList}
      </div>
    </div>

  );
}

export default App;
